<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <script src="https://code.createjs.com/1.0.0/createjs.min.js"></script>
    <title>Document</title>
    <style>
      #animation_container {
        position: absolute;
        margin: auto;
        left: 0;
        right: 0;
      }
    </style>
    <script>
      let stage;
      let spriteSheet;
      let lib = { width: 320, height: 480 }; // a library
      let player = { isShoted: false };
      let colors = [];
      let bubbleContainer;
      let isEnd = false;
      let outer;
      let bubbleGrid;
      let bulletAmount = 8;
      function gameInit() {
        dapi.isReady()
          ? onReadyCallback()
          : dapi.addEventListener("ready", onReadyCallback);
        //Here you can put other code that not related to dapi logic
        stage = new createjs.Stage("canvas");
        loadSpriteSheet();
        canvas = document.getElementById("canvas");
        anim_container = document.getElementById("animation_container");
        dom_overlay_container = document.getElementById(
          "dom_overlay_container"
        );
        if (detectMobile()) {
          // canvas.addEventListener("touchstart", onTouchStart);
          canvas.addEventListener("touchmove", onMouseMove);
          canvas.addEventListener("touchend", onMouseDown);
        } else {
          canvas.addEventListener("mousemove", onMouseMove);
          canvas.addEventListener("mousedown", onMouseDown);
        }
        makeResponsive([canvas, anim_container, dom_overlay_container]);
        createLevel();
        drawLine();
        if (detectMobile()) {
          stage.removeChild(dotContainer);
        }
        // showEndgameScreen();
      }
      function updateBulletAmount(amount) {
        bulletAmount += amount;
        lib.bulletText.set({ text: bulletAmount });
      }
      function onMouseDown(e) {
        if (isEnd || player.isShoted || bulletAmount === 0) {
          return;
        }
        updateBulletAmount(-1);
        stage.removeChild(lib.hand);
        player.isShoted = true;
        const mousePos = caculateMousePos(e);
        let magicNumber = -0.3;
        if (mousePos.y > lib.height * 0.4) {
          magicNumber = -1.4;
        }
        player.bubble.vy = (player.bubble.y - mousePos.y + 16) * magicNumber;
        player.bubble.vx = (player.bubble.x - mousePos.x + 16) * magicNumber;
        if (detectMobile()) {
          dotContainer.removeAllChildren();
        }
      }
      function onMouseMove(e) {
        // mouse move
        drawLine(caculateMousePos(e));
      }

      function caculateMousePos(e) {
        let posGlobal =
          detectMobile() === true
            ? getTouchPos(canvas, e)
            : getMousePos(canvas, e);
        return stage.globalToLocal(posGlobal.x, posGlobal.y);
      }
      function radToDeg(angle) {
        return angle * (180 / Math.PI);
      }
      function degToRad(angle) {
        return angle * (Math.PI / 180);
      }
      function getMousePos(canvas, e) {
        let rect = canvas.getBoundingClientRect();
        return {
          x: Math.round(
            ((e.clientX - rect.left) / (rect.right - rect.left)) * canvas.width
          ),
          y: Math.round(
            ((e.clientY - rect.top) / (rect.bottom - rect.top)) * canvas.height
          ),
        };
      }
      function getTouchPos(canvas, e) {
        let rect = canvas.getBoundingClientRect();
        return {
          x: Math.round(
            ((e.changedTouches[0].clientX - rect.left) /
              (rect.right - rect.left)) *
              canvas.width
          ),
          y: Math.round(
            ((e.changedTouches[0].clientY - rect.top) /
              (rect.bottom - rect.top)) *
              canvas.height
          ),
        };
      }
      function detectMobile() {
        let iOS = navigator.userAgent.match(/(iPad|iPhone|iPod)/i)
          ? true
          : false;
        if (iOS) {
          return true;
        }

        let ua = navigator.userAgent.toLowerCase();
        let isAndroid = ua.indexOf("android") > -1;
        if (isAndroid) {
          return true;
        }

        return false;
      }

      function hitTest(r1, r2) {
        if (!r1 || !r2) {
          return;
        }
        let leftMost = r1.x < r2.x ? r1 : r2;
        let rightMost = r1.x > r2.x ? r1 : r2;
        let upMost = r1.y < r2.y ? r1 : r2;
        let downMost = r1.y > r2.y ? r1 : r2;

        let upperLeft = [rightMost.x, downMost.y];
        let upperRight = [leftMost.x + leftMost.width, downMost.y];
        let lowerLeft = [rightMost.x, upMost.y + upMost.height];
        let lowerRight = [
          leftMost.x + leftMost.width,
          upMost.y + upMost.height,
        ];

        let x = upperLeft[0];
        let y = upperLeft[1];

        let width = upperRight[0] - upperLeft[0];
        let height = lowerLeft[1] - upperLeft[1];
        return width > 12 && height > 12;
      }
      function createLevel() {
        bubbleContainer = new createjs.Container();
        let map = fixMap[(3 * Math.random()) | 0];
        for (let i = 0; i < map.length; i++) {
          const row = map[i];
          let subContainer = new createjs.Container();
          for (let j = 0; j < row.length; j++) {
            const colorCode = row[j];
            if (colorCode > 0 && colors.indexOf(colorCode) === -1) {
              colors.push(colorCode);
            }
            let bubble;
            switch (colorCode) {
              case 0:
                bubble = lib.blue.clone();
                bubble.set({ color: "blue", ani: lib.blueAni.clone() });
                break;
              case 1:
                bubble = lib.green.clone();
                bubble.set({ color: "green", ani: lib.greenAni.clone() });

                break;
              case 2:
                bubble = lib.pink.clone();
                bubble.set({ color: "pink", ani: lib.pinkAni.clone() });

                break;
              case 3:
                bubble = lib.red.clone();
                bubble.set({ color: "red", ani: lib.redAni.clone() });

                break;
              case 4:
                bubble = lib.yellow.clone();
                bubble.set({ color: "yellow", ani: lib.yellowAni.clone() });

                break;
              default:
                break;
            }

            if (bubble) {
              let posX = j * 28;
              let posY = i * 25;
              if (i % 2 != 0) {
                posX = j * 28 + 15;
              }

              bubble.set({ x: posX, y: posY, scaleX: 0.6, scaleY: 0.6 });
              const bound = bubble.getTransformedBounds();
              const lowRight = {
                x: bubble.x + bound.width,
                y: bubble.y + bound.height,
              };
              if (lowRight.x > lib.width) {
                continue;
              }
              subContainer.addChild(bubble);
            } else {
              subContainer.addChild(new createjs.DisplayObject());
            }
          }
          bubbleContainer.addChild(subContainer);
        }
        stage.addChild(bubbleContainer);
        setPlayer();
        stage.addChild(lib.hand);
      }

      function getPlayerColor() {
        bubbleGrid = [];
        let colors = [];
        for (let i = 0; i < bubbleContainer.children.length; i++) {
          const sub = bubbleContainer.children[i];
          let subGrid = [];
          for (let j = 0; j < sub.children.length; j++) {
            const element = sub.children[j];
            if (element.color) {
              subGrid.push(1);

              colors.push(element.color);
            } else {
              subGrid.push(0);
            }
          }
          bubbleGrid.push(subGrid);
        }
        return colors[colors.length - 1];
      }

      function getRandomInt(min, max) {
        min = Math.ceil(min);
        max = Math.floor(max);
        return Math.floor(Math.random() * (max - min) + min); //The maximum is exclusive and the minimum is inclusive
      }

      function setPlayer() {
        player.isShoted = false;
        delete player;
        const colorCode = getPlayerColor();
        switch (colorCode) {
          case "blue":
            outer = lib.outerBlue.clone();
            player.bubble = lib.blue.clone();
            player.bubble.set({ color: "blue", ani: lib.blueAni.clone() });
            break;
          case "green":
            outer = lib.outerGreen.clone();
            player.bubble = lib.green.clone();
            player.bubble.set({ color: "green", ani: lib.greenAni.clone() });

            break;
          case "pink":
            outer = lib.outerPink.clone();
            player.bubble = lib.pink.clone();
            player.bubble.set({ color: "pink", ani: lib.pinkAni.clone() });

            break;
          case "red":
            outer = lib.outerRed.clone();
            player.bubble = lib.red.clone();
            player.bubble.set({ color: "red", ani: lib.redAni.clone() });

            break;
          case "yellow":
            outer = lib.outerYellow.clone();
            player.bubble = lib.yellow.clone();
            player.bubble.set({ color: "yellow", ani: lib.yellowAni.clone() });

            break;
          default:
            break;
        }
        if (outer && player.bubble) {
          outer.setTransform(lib.width * 0.38, lib.height * 0.8, 1.2, 1.2);
          player.bubble.setTransform(
            lib.width * 0.44,
            lib.height * 0.78,
            0.6,
            0.6
          );
          player.vx = 0;
          player.vy = 0;
        }
        stage.addChild(outer, player.bubble);
      }
      function getNumberInRange(from, to) {
        return Array.from({ length: to - from + 1 }, (_, i) => i + from);
      }

      function loadSpriteSheet() {
        let spriteElement = document.createElement("IMG");
        spriteElement.setAttribute("src", spriteBase64);
        let aniSpeed = 0.5;
        spriteSheet = new createjs.SpriteSheet({
          images: [spriteElement],
          frames,
          animations: {
            blue: { frames: getNumberInRange(1, 9), speed: aniSpeed },
            green: { frames: getNumberInRange(10, 19), speed: aniSpeed },
            pink: { frames: getNumberInRange(20, 29), speed: aniSpeed },
            red: { frames: getNumberInRange(30, 39), speed: aniSpeed },
            yellow: { frames: getNumberInRange(40, 49), speed: aniSpeed },
          },
        });
        // create spites
        lib.bg = new createjs.Sprite(spriteSheet);
        lib.bg.gotoAndStop(50);

        lib.blue = new createjs.Sprite(spriteSheet);
        lib.blue.gotoAndStop(51);
        lib.blueAni = new createjs.Sprite(spriteSheet, "blue");

        lib.circle = new createjs.Sprite(spriteSheet);
        lib.circle.gotoAndStop(52);

        lib.continueBtn = new createjs.Sprite(spriteSheet);
        lib.continueBtn.gotoAndStop(53);

        lib.green = new createjs.Sprite(spriteSheet);
        lib.green.gotoAndStop(54);
        lib.greenAni = new createjs.Sprite(spriteSheet, "green");

        lib.dinoHand = new createjs.Sprite(spriteSheet);
        lib.dinoHand.gotoAndStop(55);

        lib.installBtn = new createjs.Sprite(spriteSheet);
        lib.installBtn.gotoAndStop(56);

        lib.logo = new createjs.Sprite(spriteSheet);
        lib.logo.gotoAndStop(57);

        lib.outer2 = new createjs.Sprite(spriteSheet);
        lib.outer2.gotoAndStop(58);

        lib.outerBlue = new createjs.Sprite(spriteSheet);
        lib.outerBlue.gotoAndStop(59);

        lib.outerGreen = new createjs.Sprite(spriteSheet);
        lib.outerGreen.gotoAndStop(60);

        lib.outerPink = new createjs.Sprite(spriteSheet);
        lib.outerPink.gotoAndStop(61);

        lib.outerRed = new createjs.Sprite(spriteSheet);
        lib.outerRed.gotoAndStop(62);

        lib.outerYellow = new createjs.Sprite(spriteSheet);
        lib.outerYellow.gotoAndStop(63);

        lib.pink = new createjs.Sprite(spriteSheet);
        lib.pink.gotoAndStop(64);
        lib.pinkAni = new createjs.Sprite(spriteSheet, "pink");

        lib.red = new createjs.Sprite(spriteSheet);
        lib.red.gotoAndStop(65);
        lib.redAni = new createjs.Sprite(spriteSheet, "red");

        lib.bird = new createjs.Sprite(spriteSheet);
        lib.bird.gotoAndStop(66);

        lib.hand = new createjs.Sprite(spriteSheet);
        lib.hand.gotoAndStop(67);

        lib.dino = new createjs.Sprite(spriteSheet);
        lib.dino.gotoAndStop(68);

        lib.yellow = new createjs.Sprite(spriteSheet);
        lib.yellow.gotoAndStop(69);
        lib.yellowAni = new createjs.Sprite(spriteSheet, "yellow");

        lib.outer = new createjs.Sprite(spriteSheet);
        lib.outer.gotoAndStop(70);

        lib.bulletText = new createjs.Text(
          bulletAmount,
          "bold 38px Courier New",
          "#FF921E"
        );
        lib.bulletText.set({
          x: lib.width * 0.4855,
          y: lib.height * 0.847,
        });

        // add child
        stage.addChild(
          lib.bg,
          lib.dino,
          lib.dinoHand,
          lib.bird,
          lib.installBtn,
          lib.outer,
          lib.bulletText
        );
        stage.children.forEach((child) => {
          child.set({
            scaleX: 0.5,
            scaleY: 0.5,
          });
        });

        //set up sprite
        lib.dinoHand.set({
          x: lib.width * 0.3,
          y: lib.height * 0.78,
          scaleX: 0.45,
          scaleY: 0.45,
        });
        lib.bird.set({ x: lib.width * 0.65, y: lib.height * 0.78 });
        lib.dino.set({
          x: lib.width * 0.09,
          y: lib.height * 0.9,
          regX: 0,
          regY: 250,
          scaleX: 0.45,
          scaleY: 0.45,
        });
        lib.installBtn.set({
          x: lib.width * 0.5,
          y: lib.height * 0.965,
          regX: 99 / 2,
          regY: 35 / 2,
        });
        lib.hand.setTransform(lib.width * 0.2, lib.height * 0.55, 1, 1);
        lib.outer.set({
          x: lib.width * 0.455,
          y: lib.height * 0.84,
        });

        // // some tween

        // createjs.Tween.get(lib.dino, { loop: true })
        //   .to({ scaleY: 0.52 }, 1500)
        //   .to({ scaleY: 0.5 }, 1500);
        createjs.Tween.get(lib.dinoHand, { loop: true })
          .to({ rotation: -20 }, 1000)
          .to({ rotation: 0 }, 1000);
        createjs.Tween.get(lib.installBtn, { loop: true })
          .to({ scaleX: 0.8, scaleY: 0.8 })
          .wait(500)
          .to({ scaleX: 0.7, scaleY: 0.7 })
          .wait(500);
        createjs.Tween.get(lib.hand, { loop: true })
          .to({ x: lib.width * 0.65 }, 1000)
          .to({ x: lib.width * 0.2 }, 1000);
        // end tween
        createjs.Ticker.framerate = 60;
        createjs.Ticker.addEventListener("tick", gameLoop);
      }
      function gameLoop(event) {
        handleBullet(event);
        cutLine();
        stage.update();
        if (bulletAmount == 0) {
          bulletAmount--;
          endGame();
        }
      }
      function cutLine() {
        for (let i = bubbleContainer.children.length - 1; i >= 0; i--) {
          for (
            let j = bubbleContainer.children[i].children.length - 1;
            j >= 0;
            j--
          ) {
            const bubble = bubbleContainer.children[i].children[j];
            handleLine(bubble);
          }
        }
      }

      function countBubble() {
        let count = 0;
        for (let i = 0; i < bubbleContainer.children.length; i++) {
          for (
            let j = 0;
            j < bubbleContainer.children[i].children.length;
            j++
          ) {
            const bubble = bubbleContainer.children[i].children[j];
            if (bubble && bubble.color) {
              count++;
            }
          }
        }
        return count;
      }

      function showEndgameScreen() {
        stage.addChild(lib.logo);
        stage.addChild(lib.continueBtn);
        lib.continueBtn.on("click", () => {
          location.reload(true);
        });
        lib.logo.set({ x: lib.width * 0.08, scaleX: 0.9, scaleY: 0.9 });
        createjs.Tween.get(lib.logo).to({ y: lib.height * 0.02 }, 500);
        const bound = lib.continueBtn.getTransformedBounds();
        lib.continueBtn.set({
          x: lib.width * 0.5,
          y: lib.height,
          regX: bound.width * 0.5,
          regY: bound.height * 0.5,
          scaleX: 0.8,
          scaleY: 0.8,
        });

        createjs.Tween.get(lib.continueBtn).to({ y: lib.height * 0.55 }, 500);
        createjs.Tween.get(lib.continueBtn, { loop: true })
          .to({ scaleX: 1, scaleY: 1 })
          .wait(500)
          .to({ scaleX: 0.9, scaleY: 0.9 })
          .wait(500);
        stage.removeChild(lib.installBtn);
      }
      function handleBullet(event) {
        if (!player.bubble || !player.isShoted) {
          return;
        }
        let radius = 3;
        let speed = 0.3;
        // bullet hit the border
        if (player.bubble.x > lib.width * 0.9 - radius) {
          player.bubble.vx *= -1;
          player.bubble.x += speed * player.bubble.vx;
        } else if (player.bubble.x < radius) {
          player.bubble.vx *= -1;
          player.bubble.x += speed * player.bubble.vx;
        }
        if (player.bubble.y > lib.height - radius || player.bubble.y < -50) {
          resetBullet();
          return;
        }
        player.bubble.x += speed * player.bubble.vx;
        player.bubble.y += speed * player.bubble.vy;

        for (let i = bubbleContainer.children.length - 1; i >= 0; i--) {
          for (
            let j = bubbleContainer.children[i].children.length - 1;
            j >= 0;
            j--
          ) {
            const bubble = bubbleContainer.children[i].children[j];
            if (
              hitTest(
                player.bubble.getTransformedBounds(),
                bubble.getTransformedBounds()
              )
            ) {
              player.isShoted = false;
              let align = 13;
              if (player.bubble.x <= bubble.x) {
                align = -13;
              }
              player.bubble.set({ x: bubble.x + align, y: bubble.y + 25 });
              // resetBullet();
              // return;
              if (player.bubble.y > lib.height * 0.8) {
                endGame();
              }
              // make collision animation
              let timeline = someAnimation(i, j);
              timeline.paused = false;
              timeline.onComplete = removeBubble(i, j, align);
              return;
            }
          }
        }
      }

      function removeBubble(i, j, align) {
        // remove bubbles
        checkBubble(i, j, player.bubble);
        if (animationArray.length === 0) {
          // add player to container
          if (!bubbleContainer.children[i + 1]) {
            const subContainer = new createjs.Container();
            for (let index = 0; index < 11; index++) {
              subContainer.addChild(new createjs.DisplayObject());
            }
            bubbleContainer.addChild(subContainer);
          }
          const tmpBubble = player.bubble.clone();
          let posJ = align > 0 ? j + 1 : j;
          if (
            bubbleContainer.children[i + 1].children[posJ] &&
            bubbleContainer.children[i + 1].children[posJ].color
          ) {
            posJ += 1;
          }
          bubbleContainer.children[i + 1].children[posJ] = tmpBubble;
          bubbleContainer.children[i + 1].children[posJ].set({
            color: player.bubble.color,
            ani: player.bubble.ani,
          });
          stage.removeChild(player.bubble);
          taskAfterAnimation();
        } else {
          runAnimation();
        }
      }

      function taskAfterAnimation() {
        resetBullet();
        // drop empty
        dropEmptyRow();
        // check end game
        if (countBubble() == 0) {
          endGame();
        }
      }

      function sleep(milliseconds) {
        const date = Date.now();
        let currentDate = null;
        do {
          currentDate = Date.now();
        } while (currentDate - date < milliseconds);
      }

      function endGame() {
        isEnd = true;
        setTimeout(function () {
          showEndgameScreen();
        }, 500);
      }

      function someAnimation(i, j) {
        let timeline = new createjs.Timeline({ paused: true });
        const nearBy = getNearBy(i, j);
        nearBy.forEach((sub) => {
          sub.forEach((pos) => {
            if (
              pos.i < bubbleContainer.children.length &&
              bubbleContainer.children[pos.i] &&
              pos.j < bubbleContainer.children[i].children.length
            ) {
              const bubble = bubbleContainer.children[pos.i].children[pos.j];
              if (bubble) {
                const tween = new createjs.Tween(
                  bubbleContainer.children[pos.i].children[pos.j]
                )
                  .to({ y: bubble.y - 10 }, Math.floor(Math.random() * 100))
                  .to({ y: bubble.y }, Math.floor(Math.random() * 100));
                timeline.addTween(tween);
              }
            }
          });
        });
        return timeline;
      }
      function handleLine(bubble) {
        for (var i = 0; i < dotContainer.children.length; i++) {
          const dot = dotContainer.children[i];
          if (
            hitTest(dot.getTransformedBounds(), bubble.getTransformedBounds())
          ) {
            getNumberInRange(i, dotContainer.children.length)
              .reverse()
              .forEach((i) => dotContainer.removeChildAt(i));
            return;
          }
        }
      }
      let dotContainer;
      function drawLine(mousePos, originPos, isRecursion) {
        if (isEnd) {
          stage.removeChild(dotContainer);
          return;
        }
        if (!isRecursion) {
          stage.removeChild(dotContainer);
          dotContainer = new createjs.Container();
        }

        if (!mousePos) {
          mousePos = { x: lib.width * 0.44, y: 0 };
        }
        if (!originPos) {
          originPos = { x: lib.width * 0.488, y: lib.height * 0.8 };
        }

        for (let y = originPos.y - 10; y > 0; y -= 10) {
          const dot = lib.pink.clone();
          const x = caculateEndPoint(mousePos, originPos, y).x;
          const angle = 10;
          if (x < 0) {
            drawLine({ x: x + angle, y: y - angle }, { x, y }, true);
            break;
          } else if (x > lib.width) {
            drawLine({ x: x - angle, y: y - angle }, { x, y }, true);
            break;
          }
          dot.set({
            x,
            y,
            scaleX: 0.1,
            scaleY: 0.1,
          });
          dotContainer.addChild(dot);
        }
        stage.addChild(dotContainer);
      }
      function caculateEndPoint(mousePos, originPos, y) {
        /*
              a = y2 - y1
              b = x1 - x2
              c = ax1 + by1
              */

        const a = originPos.y - mousePos.y;
        const b = mousePos.x - originPos.x;
        const c = a * mousePos.x + b * mousePos.y;
        let x = (c - b * y) / a;

        return { x, y };
      }
      function dropEmptyRow() {
        let toDropBubbles = [];
        // return index of the empty row
        for (let i = 0; i < bubbleGrid.length - 1; i++) {
          for (let j = 0; j < bubbleGrid[i].length; j++) {
            let padding = 0;
            if (i == 0) {
              continue;
            }
            if (i % 2 == 0) {
              padding = 1;
            }
            if (
              bubbleGrid[i][j] &&
              !bubbleGrid[i - 1][j - padding] &&
              !bubbleGrid[i - 1][j + 1 - padding]
            ) {
              let tmpBubble = bubbleContainer.children[i].children[j].clone();
              stage.addChild(tmpBubble);
              bubbleContainer.children[i].children[
                j
              ] = new createjs.DisplayObject();
              toDropBubbles.push(tmpBubble);
              bubbleGrid[i][j] = 0;
            }
          }
        }
        resetBullet();

        toDropBubbles.forEach((tmpBubble) => {
          createjs.Tween.get(tmpBubble, { loop: true })
            .to({ y: tmpBubble.y + 40 }, Math.floor(Math.random() * 200) + 200)
            .call(() => {
              stage.removeChild(tmpBubble);
            });
        });
      }
      let toExcludeCheck = [];
      let animationArray = [];
      let aniCounter = 0;
      function runAnimation() {
        let animationInterval = setInterval(
          function () {
            if (aniCounter < animationArray.length) {
              const bubble = animationArray[aniCounter];
              bubbleContainer.children[bubble.i].children[
                bubble.j
              ] = new createjs.DisplayObject();
              stage.addChild(bubble.ani);
              bubble.ani.play();
              stage.removeChild(bubble.tmpBubble);
              bubble.ani.on("animationend", () => {
                stage.removeChild(bubble.ani);
              });
              aniCounter++;
            } else {
              const playerAni = player.bubble.ani.clone();
              stage.addChild(playerAni);
              playerAni.set({
                x: player.bubble.x,
                y: player.bubble.y,
                scaleX: player.bubble.scaleX,
                scaleY: player.bubble.scaleY,
              });
              playerAni.play();
              playerAni.on("animationend", () => {
                stage.removeChild(playerAni);
              });
              stage.removeChild(player.bubble);
              aniCounter = 0;
              animationArray = [];

              clearInterval(animationInterval);
              return;

      function getNearBy(i, j) {
        return [
          [
            { i: i - 1, j: j - 1 },
            { i: i - 1, j: j },
            { i: i - 1, j: j + 1 },
          ],
          [
            { i: i, j: j - 1 },
            { i: i, j: j },
            { i: i, j: j + 1 },
          ],
          [
            { i: i + 1, j: j - 1 },
            { i: i + 1, j: j },
            { i: i + 1, j: j + 1 },
          ],
        ];
      }
      function checkBubble(i, j, target) {
        if (
          toExcludeCheck.some((e) => e.pos1 === i && e.pos2 === j) ||
          i < 0 ||
          j < 0 ||
          i > 15 ||
          j > 15
        ) {
          return;
        }
        toExcludeCheck.push({ pos1: i, pos2: j });
        let arr = [];
        const nearBy = getNearBy(i, j);
        for (let i = 0; i < nearBy.length; i++) {
          const element = nearBy[i];
          for (let j = 0; j < element.length; j++) {
            const obj = element[j];
            if (bubbleContainer.children[obj.i]) {
              // bubbleContainer.children[obj.i].children[
              //   obj.j
              // ] = new createjs.DisplayObject();
              const bubble = bubbleContainer.children[obj.i].children[obj.j];
              if (bubble && bubble.color === target.color) {
                // drawCircle(bubble.getTransformedBounds());
                if (
                  !animationArray.some(
                    (ani) => ani.i === obj.i && ani.j === obj.j
                  )
                ) {
                  bubble.ani.set({
                    x: bubble.x,
                    y: bubble.y,
                    scaleX: bubble.scaleX,
                    scaleY: bubble.scaleY,
                  });
                  bubble.ani.stop();
                  const tmpBubble = bubble.clone();
                  // stage.addChild(tmpBubble);
                  animationArray.push({
                    ani: bubble.ani,
                    i: obj.i,
                    j: obj.j,
                    tmpBubble,
                  });
                }
                checkBubble(obj.i, obj.j, bubble);
              }
            }
          }
        }
      }

      function drawCircle(bound, isOther) {
        let g = new createjs.Graphics();
        g.setStrokeStyle(3);
        if (isOther) {
          g.beginStroke(createjs.Graphics.getRGB(255, 0, 0));
        } else {
          g.beginStroke(createjs.Graphics.getRGB(255, 255, 255));
        }
        g.drawCircle(bound.x + 20, bound.y + 15, bound.width * 0.4);
        let s = new createjs.Shape(g);
        stage.addChild(s);
        createjs.Tween.get(s)
          .to({ alpha: 0 }, 200, createjs.Ease.getPowInOut(2))
          .call(() => {
            stage.removeChild(s);
          });
      }

          let pRatio = window.devicePixelRatio || 2,
            xRatio = iw / w,

          let sRatio = Math.min(xRatio, yRatio);

          domContainers[0].width = w * pRatio * sRatio;

          domContainers.forEach(function (container) {
            container.style.width = w * sRatio + "px";

          stage.scaleX = pRatio * sRatio;
          stage.scaleY = pRatio * sRatio;
          lastW = iw;
          lastH = ih;
          lastS = sRatio;
          stage.tickOnUpdate = false;
          stage.update();
          stage.tickOnUpdate = true;
        }
